export const colors = (alpha = 1) => {
    return {
        navy1: `rgba(15, 32, 39, ${alpha})`,
        navy2: `rgba(32, 58, 67, ${alpha})`,
        navy3: `rgba(44, 83, 100, ${alpha})`,
        orange: `rgba(246, 147, 5, ${alpha}),`,
        violet: `rgba(116, 97, 201, ${alpha}),`,
    }
}
